INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (7001, 1, 7, 106001, 0, "キャル", -363.0, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", 0, 1, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (7002, 1, 7, 105901, 0, "コッコロ", -363.0, "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", 0, 1, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (7003, 1, 7, 105801, 0, "ペコリーヌ", -363.0, "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", 0, 1, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (10001, 1, 10, 105801, 0, "ペコリーヌ", -363.0, "ジュエルを食べ物…\nいえ、貴重品と交換できます！", 0, 1, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (10002, 1, 10, 106001, 0, "キャル", -363.0, "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", 0, 1, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (10003, 1, 10, 105901, 0, "コッコロ", -363.0, "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", 0, 1, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (10004, 1, 10, 106401, 0, "シェフィ", -363.0, "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", 2104010, 1, 0.0, 2, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (12001, 1, 12, 105801, 0, "ペコリーヌ", -416.5, "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", 0, 1, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (13001, 1, 13, 106001, 0, "キャル", -363.0, "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", 0, 1, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (13002, 1, 13, 105901, 0, "コッコロ", -363.0, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", 0, 1, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (13003, 1, 13, 106401, 0, "シェフィ", -363.0, "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", 2104010, 1, 0.0, 2, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (13004, 1, 13, 105801, 0, "ペコリーヌ", -363.0, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", 0, 1, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (14001, 1, 14, 105901, 0, "コッコロ", -363.0, "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", 0, 1, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (14002, 1, 14, 106401, 0, "シェフィ", -363.0, "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", 2104010, 1, 0.0, 2, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (14003, 1, 14, 105801, 0, "ペコリーヌ", -363.0, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", 0, 1, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (14004, 1, 14, 106001, 0, "キャル", -363.0, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", 0, 1, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (15001, 1, 15, 105901, 0, "コッコロ", -470.0, "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", 0, 1, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (16001, 1, 16, 106401, 0, "シェフィ", -363.0, "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", 2104010, 1, 0.0, 2, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (16002, 1, 16, 105801, 0, "ペコリーヌ", -363.0, "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", 0, 1, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (16003, 1, 16, 106001, 0, "キャル", -363.0, "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", 0, 1, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (16004, 1, 16, 105901, 0, "コッコロ", -363.0, "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", 0, 1, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (17002, 1, 17, 105901, 0, "コッコロ", -363.0, " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", 0, 1, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (17004, 1, 25, 106001, 0, "キャル", -363.0, "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", 0, 1, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (17005, 1, 25, 105901, 0, "コッコロ", -363.0, "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", 0, 1, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (17006, 1, 25, 106401, 0, "シェフィ", -363.0, "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ", 2104010, 1, 0.0, 2, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (17007, 1, 25, 105801, 0, "ペコリーヌ", -363.0, "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", 0, 1, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (18001, 1, 18, 190801, 0, "カリン", -363.0, "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", 0, 1, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (18002, 1, 18, 190801, 0, "カリン", -363.0, "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！", 0, 2, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (19001, 1, 19, 190801, 0, "カリン", -470.0, "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね", 0, 3, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (19002, 1, 19, 190801, 0, "カリン", -470.0, "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪", 0, 4, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (20001, 1, 20, 190801, 0, "カリン", -470.0, "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", 0, 5, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (20002, 1, 20, 190801, 0, "カリン", -470.0, "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", 0, 6, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (21001, 1, 21, 106001, 0, "キャル", -363.0, "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", 0, 1, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (21002, 1, 21, 105901, 0, "コッコロ", -363.0, "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", 0, 1, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (21003, 1, 21, 106401, 0, "シェフィ", -363.0, "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう", 2104010, 1, 0.0, 2, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (21004, 1, 21, 105801, 0, "ペコリーヌ", -363.0, "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", 0, 1, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (22001, 1, 22, 190801, 0, "カリン", -430.0, "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", 0, 1, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (22002, 1, 22, 190801, 0, "カリン", -430.0, "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", 0, 2, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (23001, 1, 23, 190801, 0, "カリン", -430.0, "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", 0, 3, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (23002, 1, 23, 190801, 0, "カリン", -430.0, "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", 0, 4, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (24001, 2, 24, 109001, 10011, "エリコ（バレンタイン）", -385.0, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", 0, 1, 8.0, 1, "2030/12/17 14:59:59", 4.08, "2019/01/31 12:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (24002, 2, 24, 109001, 10011, "エリコ（バレンタイン）", -385.0, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", 0, 2, 8.0, 1, "2030/12/17 14:59:59", 5.0, "2019/01/31 12:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (24003, 2, 24, 109001, 10011, "エリコ（バレンタイン）", -385.0, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", 0, 3, 8.0, 1, "2030/12/17 14:59:59", 10.11, "2019/01/31 12:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (24004, 2, 24, 109001, 10011, "エリコ（バレンタイン）", -385.0, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", 0, 4, 8.0, 1, "2030/12/17 14:59:59", 4.0, "2019/01/31 12:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (24005, 2, 24, 109001, 10011, "エリコ（バレンタイン）", -385.0, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", 0, 5, 8.0, 1, "2030/12/17 14:59:59", 6.0, "2019/01/31 12:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (24006, 1, 24, 109002, 10011, "エリコ（バレンタイン）", 0.0, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 0, 6, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2019/01/31 12:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (24007, 1, 24, 109002, 10011, "エリコ（バレンタイン）", 0.0, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 0, 7, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2019/01/31 12:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (24008, 1, 24, 109002, 10011, "エリコ（バレンタイン）", 0.0, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 0, 8, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2019/01/31 12:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (24009, 1, 24, 109002, 10011, "エリコ（バレンタイン）", 0.0, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", 0, 9, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2019/01/31 12:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (24010, 1, 24, 109002, 10011, "エリコ（バレンタイン）", 0.0, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 0, 10, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2019/01/31 12:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (24011, 2, 24, 109101, 10011, "シズル（バレンタイン）", -385.0, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", 0, 1, 8.0, 1, "2030/12/17 14:59:59", 2.12, "2019/01/31 12:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (24012, 2, 24, 109101, 10011, "シズル（バレンタイン）", -385.0, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", 0, 2, 8.0, 5, "2030/12/17 14:59:59", 4.19, "2019/01/31 12:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (24013, 4, 24, 109101, 10011, "シズル（バレンタイン）", -385.0, "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", 0, 3, 8.0, 2, "2030/12/17 14:59:59", 2.3, "2019/01/31 12:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (24014, 1, 24, 109102, 10011, "シズル（バレンタイン）", 0.0, "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", 0, 4, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2019/01/31 12:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (24015, 2, 24, 109101, 10011, "シズル（バレンタイン）", -385.0, "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", 0, 5, 8.0, 5, "2030/12/17 14:59:59", 5.23, "2019/01/31 12:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (24016, 1, 24, 109102, 10011, "シズル（バレンタイン）", 0.0, "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", 0, 6, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2019/01/31 12:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (24017, 2, 24, 109101, 10011, "シズル（バレンタイン）", -385.0, "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", 0, 7, 8.0, 1, "2030/12/17 14:59:59", 5.01, "2019/01/31 12:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (24018, 1, 24, 109102, 10011, "シズル（バレンタイン）", 0.0, "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", 0, 8, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2019/01/31 12:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (24019, 1, 24, 109102, 10011, "シズル（バレンタイン）", 0.0, "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", 0, 9, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2019/01/31 12:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (24020, 1, 24, 109102, 10011, "シズル（バレンタイン）", 0.0, "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪", 0, 10, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2019/01/31 12:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (26001, 1, 26, 106401, 0, "シェフィ", -363.0, "ここから先は神聖な場所みたい\nどんなお宝が眠っているのか、\n今から探索するのが楽しみね♪", 2104010, 1, 0.0, 2, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (26002, 1, 26, 105801, 0, "ペコリーヌ", -363.0, "ここから先は神聖な場所\nみたいです！\nどんなお宝が手に入るか\n楽しみですね！", 0, 1, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (26003, 1, 26, 106001, 0, "キャル", -363.0, "この先は神聖な場所みたい。\n手に入るお宝も並じゃないけど\n気を付けていかないと\n痛い目にあうわよ", 0, 1, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (26004, 1, 26, 105901, 0, "コッコロ", -363.0, "ここから先は神聖な場所\nでございます。\n気を引き締めてお宝の\n調査探索に参りましょう", 0, 1, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (27001, 1, 27, 106401, 0, "シェフィ", -363.0, "ここにさらなる力を得るための\nアイテムが眠っている…って\nみんな言ってるわ。ふふっ、\nそれじゃあ挑戦してみましょうか", 2104010, 1, 0.0, 2, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (27002, 1, 27, 105801, 0, "ペコリーヌ", -363.0, "ここにさらなる力を得るための\nアイテムが眠っているみたい\nです！　どこから挑戦するか\n迷っちゃいますね！", 0, 1, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (27003, 1, 27, 106001, 0, "キャル", -363.0, "ここにさらなる力を得るための\nアイテムが眠っているみたい！\nどんどん挑戦して\n強くなっちゃいましょ！", 0, 1, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (27004, 1, 27, 105901, 0, "コッコロ", -363.0, "こちらにさらなる力を得る\nためのアイテムが眠っている\nようです。主さま、どこから\n挑戦いたしましょう。", 0, 1, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (28001, 1, 28, 190801, 0, "カリン", -363.0, "ようこそ！\n皆さんの素敵な出会いを\nギルド管理協会が\nお手伝いします！", 0, 1, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2019/09/24 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (28002, 1, 28, 190801, 0, "カリン", -363.0, "ギルド管理協会です\nフレンドに関しては\nこちらでご確認ください", 0, 2, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2019/09/24 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (29001, 1, 29, 190801, 0, "カリン", -409.0, "こちらがフレンドの\n皆さんです\n素敵な関係を\n築いてくださいね！", 0, 3, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2019/09/24 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (29002, 1, 29, 190801, 0, "カリン", -409.0, "こちらの一覧で\nフレンドのプロフィールを\n確認できますよ", 0, 4, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2019/09/24 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (30001, 1, 30, 190801, 0, "カリン", -409.0, "フレンド管理は\nこちらになります\n新しいフレンドとの出会いを\n楽しんでくださいね！", 0, 5, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2019/09/24 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (30002, 1, 30, 190801, 0, "カリン", -409.0, "フレンドの申請や\n承認ができますよ\nどうぞ、良き交流を！", 0, 6, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2019/09/24 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (31001, 1, 31, 190801, 0, "カリン", -409.0, "バトルをして力比べを\nしてみましょう！\n実力が試されますね、\n頑張ってください！", 0, 7, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2019/10/31 12:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (31002, 1, 31, 190801, 0, "カリン", -409.0, "気になるパーティと\nバトルをしてみましょう！\nどちらが勝利するのか、\n私も楽しみにしていますね", 0, 8, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2019/10/31 12:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (32001, 1, 32, 190801, 0, "カリン", -409.0, "ルーキーの皆さんのために\n特別なミッションを\nご用意いたしました！\nぜひ、挑戦してください！", 0, 1, 0.0, 1, "2020/01/04 4:59:59", 0.0, "2019/12/20 5:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (32002, 1, 32, 190801, 0, "カリン", -409.0, "期間限定のキャンペーンを\n開催中です！\nミッションにチャレンジ\nしましょう！", 0, 2, 0.0, 1, "2020/01/04 4:59:59", 0.0, "2019/12/20 5:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (33001, 1, 33, 190801, 0, "カリン", -409.0, "フレンドになって\n初心者の方を応援しましょう！\n素敵な報酬が待っていますよ！", 0, 3, 0.0, 1, "2020/01/04 4:59:59", 0.0, "2019/12/20 5:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (33002, 1, 33, 190801, 0, "カリン", -409.0, "期間限定のキャンペーンを\n開催中です！\nミッションにチャレンジ\nしましょう！", 0, 4, 0.0, 1, "2020/01/04 4:59:59", 0.0, "2019/12/20 5:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (34001, 1, 34, 190801, 0, "カリン", -409.0, "お疲れ様でした！\nミッションの報酬の受け取りは\nこちらからできますよ！", 0, 5, 0.0, 1, "2020/01/10 11:59:59", 0.0, "2020/01/04 5:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (34002, 1, 34, 190801, 0, "カリン", -409.0, "ミッション報酬の受け取りは\nこちら！\n受け取り漏れの無いように\n気を付けてくださいね！", 0, 6, 0.0, 1, "2020/01/10 11:59:59", 0.0, "2020/01/04 5:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (38001, 2, 38, 105801, 0, "ペコリーヌ", -458.0, "過去のストーリーイベントを\n楽しめちゃいますよ！\n遊んだことのないものがあれば\n一緒にやってみましょう♪", 0, 1, 0.0, 1, "2030/12/17 14:59:59", 5.3, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (38002, 2, 38, 105801, 0, "ペコリーヌ", -458.0, "これまでのイベントで登場した\n限定キャラを仲間にできたり\nメモリーピースが手に入る\nみたいですよ。やばいですね☆", 0, 2, 0.0, 1, "2030/12/17 14:59:59", 6.5, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (39005, 3, 39, 105801, 0, "ペコリーヌ", 9999.0, "", 0, 0, 9999.0, 3, "2020/04/08 23:59:59", 0.0, "2020/04/01");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (40001, 1, 40, 190801, 0, "カリン", -430.0, "これまでに出題された\n問題を振り返ることが\nできますよ\n復習は大切です♪", 0, 2, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (41001, 1, 41, 106401, 0, "シェフィ", -363.0, "ここでは腕試しが\nできるんですって。\n自分の実力を測るのに、\nちょうどよさそうね。", 2104010, 1, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (41002, 1, 41, 105801, 0, "ペコリーヌ", -363.0, "ここで腕試しを\nしていきましょう！\n全力全開、\nがんばっちゃいますよ～！", 0, 1, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (41003, 1, 41, 106001, 0, "キャル", -363.0, "ここで腕試しが\nできるみたいね。\n試してみるのも\nいいんじゃない？", 0, 1, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (41004, 1, 41, 105901, 0, "コッコロ", -363.0, "腕試しができるようです。\nここで練習を重ね、実戦に\n活かしてまいりましょう。", 0, 1, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (42001, 1, 42, 105901, 0, "コッコロ", -416.5, "訓練の成果に応じて、\n報酬がもらえるそうです。\n共に励んでいきましょう。", 0, 1, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (42002, 1, 42, 106401, 0, "シェフィ", -416.5, "目標を達成すれば、\n報酬がもらえるみたい。\n頑張り甲斐があるわね。", 2104010, 1, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (42003, 1, 42, 105801, 0, "ペコリーヌ", -416.5, "腕試しをがんばれば、\n報酬がもらえますよ。\n挑戦していきましょう☆", 0, 1, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (42004, 1, 42, 106001, 0, "キャル", -416.5, "ミッションを達成すると、\n報酬が出るんですって。\n一緒にやってみましょ！", 0, 1, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (43001, 1, 43, 105801, 0, "ペコリーヌ", -363.0, "ここからアリーナに\n挑戦できますよ！\n編成を工夫してライバルに\n挑んじゃいましょう！", 0, 1, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (43002, 1, 43, 105901, 0, "コッコロ", -363.0, "こちらからアリーナに\n挑戦することができます。\n主さまらしい編成で\nライバルに挑みましょう。", 0, 1, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (43003, 1, 43, 106001, 0, "キャル", -363.0, "ここからアリーナに\n挑戦できるわよ！\nしっかり編成を考えて\nライバルに挑みなさい！", 0, 1, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (43004, 1, 44, 123001, 0, "アメス", -416.5, "ミッションをクリアすると報酬が\n受け取れるわ。ジャンジャン\nクリアしてバリバリ強化して\nあげなさい♪", 0, 1, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (43005, 1, 44, 123001, 0, "アメス", -416.5, "ぼんやりしてる場合じゃないわ。\n早くミッションをクリアして\n報酬を受け取ってきなさい！", 0, 2, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (43006, 2, 45, 123001, 0, "アメス", -416.5, "ちょっとあんた、報酬が\n受け取れるじゃない！\n忘れずにチェックなさい。\nアメス様との約束よ？", 0, 3, 0.0, 1, "2030/12/17 14:59:59", 5.79, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (46001, 1, 46, 123001, 0, "アメス", -371.5, "はい、お疲れさま。\nここではマスタリーチケットを\n使って、マスタリー強化素材を\n手に入れることができるわよ。", 0, 1, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (47001, 2, 47, 104901, 0, "シズル", -416.5, "呼ばれて飛び出てお姉ちゃんだよ♪\nたとえ火の中、水の中、迷宮の中っ\nこのダンジョンを踏破できるよう\n弟くんを応援してあげるからねっ♪", 0, 1, 0.0, 2, "2030/12/17 14:59:59", 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (47002, 2, 47, 101101, 0, "リノ", -416.5, "ほんとーに不思議な場所ですね～\nお兄ちゃんが冒険を頑張れるよう\nおまじないをかけてあげますねっ\nフレーフレー、お・兄・ちゃんっ♪", 0, 1, 0.0, 1, "2030/12/17 14:59:59", 9.32, "2015/12/17 15:00:00");
